package com.syntax.class02;

public class Differences {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String a="Hello";
		String b="bye";
		
		int c=10;
		int d=20;
		
		System.out.println(c+d+a+b);
		System.out.println(a+b+c+d);
		System.out.println(a+b+(c+d));
	}

}
